local js = require("js")
local window = js.global
local document = window.document


mwi_keys_keys = {} --??? man this naming
for i=1,#mwi_keys do
    mwi_keys_keys[#mwi_keys_keys+1] = i
end
table.sort(mwi_keys_keys, function(a,b)
    local ma = mwi_keys[a]
    local mb = mwi_keys[b]
    return ma < mb
end)

function populateModifierList()
    local modifierList = document:getElementById("modifierChoice")   
    for i=1,#mwi_keys_keys do
        local idx = mwi_keys_keys[i]
        local d = mwi_keys[idx]
        local option = document:createElement("option")
        if (d:sub(-1) == ":") then d = d:sub(1,-2) end
        option.text = d
        option.value = idx
        modifierList:add(option)
    end
end

function updateStats()
    local endtext = ""
    local choice = tonumber(document:getElementById("modifierChoice").value)
    local d = data[choice]
    if (not choice or choice == "" or (not d)) then
        document:getElementById("stats_div").innerHTML = endtext    
        return
    end

    local d_key = {}
    for i,v in pairs(d) do d_key[#d_key + 1] = i end -- list of item ids
    local sort_name = document:getElementById("item_name_rb").checked
    local sort_value= document:getElementById("item_value_rb").checked
    
    if (sort_value) then
        table.sort(d_key, function(a,b)
            local ma = mwi_vals[d[a]]
            local mb = mwi_vals[d[b]]
            if (ma == mb) then
                return mwi_items[a] < mwi_items[b]
            end
            local vala = tonumber((ma:match("/?([-%d]+)%%?$")) or ma) or ma
            local valb = tonumber((mb:match("/?([-%d]+)%%?$")) or mb) or mb
            if (vala < 0 and valb < 0) then
                return valb > vala -- smaller first
            end
            return vala > valb -- larger first
        end)
    else -- sort by name
        table.sort(d_key, function(a,b)
            local ma = mwi_items[a]
            local mb = mwi_items[b]
            return ma < mb
        end)
    end
    
    for i=1,#d_key do
        local di = d_key[i] -- item id
        local inom = mwi_items[di] -- item name
        local ival = mwi_vals[d[di]] -- value
        endtext = endtext .. ("* %s: %s<br>"):format(inom,ival)
    end
    
    document:getElementById("stats_div").innerHTML = endtext
end


document:getElementById("modifierChoice").onchange = updateStats
document:getElementById("item_name_rb").onchange = updateStats
document:getElementById("item_value_rb").onchange = updateStats


populateModifierList()

document:getElementById("nowLoading").style.display = "none"
document:getElementById("wrapper").style.display = "inline"



